import React from 'react';
import './Timetable.css';

function Timetable() {
  return (
    <div className="timetable-container">
      <h1>School Timetable</h1>
      <p>Yearly timetable content will be available here.</p>
      {/* Timetable interface */}
    </div>
  );
}

export default Timetable;
